<!doctype html>
<html lang="en">

<head>
    <title>Code coverage report</title>
    <link rel="stylesheet" href="../../../base.css" />
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1">
</head>

<body>
    <h3 style="margin: 16px 0 4px 32px">Method</h3>
    <pre class="source"><span><a href="../../../index.html">all packages</a></span><span style="margin-left: 10px"><a href="../../index.html">{{package}}</a></span><span style="margin-left: 10px"><a href="../index.html">{{class}}</a></span><span class="strong" style="margin-left: 10px">{{method}}</span></pre>
    {{summary}}
    <pre>
        <table class="coverage">
            <tbody>
                <tr>
                    <td class="line-coverage quiet">{{coverage}}</td>
                    <td class="line-count quiet">{{numbers}}</td>
                    <td class="code"><pre style="margin: 0px;"><code class="matlab" style="padding: 0px;">{{code}}</code></pre></td>
                </tr>
            </tbody>
        </table>
    </pre>
</body>

<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/9.12.0/styles/github.min.css">
<script src="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/9.12.0/highlight.min.js"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/9.12.0/languages/matlab.min.js"></script>
<script>
    hljs.initHighlightingOnLoad();
</script>


</html>
